import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { useParams } from 'react-router-dom';
import { loadItems } from '../../store/Items.actions';
//import { loadOneItemGroup } from '../../store/ItemGroups.actions';
import Button from '@mui/material/Button';


function Webshop () {
    const { itemGroupId } = useParams();
    const dispatch = useDispatch();
    const items = useSelector(state => state.item);
//    const groupSelector = useSelector(state => state.itemGroup);
//    const itemGroup = groupSelector[itemGroupId];

    useEffect(() => {
        async function load() {
            dispatch (loadItems());
            }
            load();
        },[dispatch]);

        console.log(`items returns `, items);


    return (
        <div className='Webshop'>
            <p>{items?.name}</p>
            <p>{items?.description}</p>
            <p>{items?.price}</p>
        </div>
    );
};

export default Webshop;
